import React from 'react';
import { List } from 'antd-mobile';
import { ShopbagOutline } from 'antd-mobile-icons';
import '../global.css';

const recommends = [
  { name: '', desc: '', address: 'XX123' },
  { name: '', desc: '', address: '' },
];

export default function RecommendPage() {
  return (
    <div style={{ padding: 20 }}>
      <h3 style={{ marginBottom: 24 }}><ShopbagOutline className="air-icon" /> </h3>
      <div className="air-list">
        <List>
          {recommends.map(item => (
            <List.Item key={item.name} description={item.desc}>
              <div style={{ fontWeight: 600 }}>{item.name}</div>
              <div style={{ fontSize: 12, color: '#888' }}>{item.address}</div>
            </List.Item>
          ))}
        </List>
      </div>
    </div>
  );
}

